import React from 'react';

const LoginPage = () => {
    return (
        <div>
            <h1>LOGIN</h1>
            <form>
                <label className= "" htmlFor = "loginId">Login ID:</label>
                <input className= "" type = "text" name = "loginId"/>
                <label className= "" htmlFor ="password">Enter Password:</label>
                <input className= "" type = "text" name = "password"/>
            </form>
        </div>
    );
};

export default LoginPage;
